import {LogoG,BtnG,getTheme,JoinROOM} from '../includes/SvgObj';
const Home = ({navigation,route,dispatch,goTo,JoinROOM})=>{
var [timer,SetTimer] = React.useState(0);
var [Roomconnected,SetRoomconnected] = React.useState(false);
var [loading,setLoading] = React.useState(false);
var [street,setStreet] = React.useState("");
var [messege,setMessage] = React.useState("");
var [darkmode,setDarkMode] = React.useState(true);
var [connectionTime,setConnectionTime] = React.useState("00:00:00");
const [room_name,setRoom_name] = React.useState("");
const [nickname,setNickName] = React.useState("");
const {googleKey} = useSelector(state=>state.Reducer);
const [joinRoom,setjoinRoom] = React.useState(false);
const connectToRoom = ()=>
{
  if(!loading && !Roomconnected)
  {
   var data = {
    user_driving: "Yes",
    user_traffik_status: "Yes"
  }
  setLoading(true);
  SetRoomconnected(false);
  setMessage("")
  PostDATA("users_connect",data).then((res)=>{
  setLoading(false);
  if(IntV != null)
  {
    clearInterval(IntV)
  }
  // alert(JSON.stringify(res))
  if(!res.status)
  {
    alert(JSON.stringify(res.message));
  }else{
    SetRoomconnected(true);
    setMessage(res.message);
    setRoom_name(res.data.room_name);
    setNickName(res.data.nickname)
    IntV = setInterval(()=>{
      setConnectionTime(Moment().format("hh:mm:ss A"))
    },1000)
    dispatch({type:"update",data:{chatroom:"x"}})
  }
})
  }else{
    SetRoomconnected(false);
    if(IntV)
  {
   clearInterval(IntV);
  }
  }
}
const theme = darkmode?{backgroundColor:"black",color:"white"}:{backgroundColor:"white",color:"black"}
return (<View style={{height,width,padding:40,justifyContent:"center",alignItems:"center",backgroundColor:theme.backgroundColor}}>
        
           <BackG 
           props={{style:{width,height,position:"absolute",top:0,left:0}}}
           />
            <View style={{flexDirection:"column",justifyContent:"center",alignItems:"center"}}>
            <Text style={{fontSize:10,fontWeight:"bold",color:theme.color}}>{connectionTime}</Text>
          <GradientText 
          text={room_name}
          textStyle={{fontSize:String(room_name).length > 20?15:30,fontWeight:"bold"}}
          />
           <Text style={{fontSize:10,color:theme.color}}>{Roomconnected?"Connected":"Not connected"} </Text>
           </View>
           <View style={{flex:1,justifyContent:"center",alignItems:"center",height:height/2}}>
            <TouchableOpacity 
            disabled={loading}
            onPress={connectToRoom}
            style={{justifyContent:"center",alignItems:"center",width:205,height:205}}>
        <ConnectBtn 
        connect={!Roomconnected}
        loading={loading}
        theme={theme}
        />
        {loading?<Text style={{color:"white",position:"absolute",fontSize:12}}>Connecting...</Text>:!Roomconnected?<Text style={{color:"white",position:"absolute",paddingTop:45}}>Start</Text>:<View style={{position:"absolute",paddingTop:38,flexDirection:"column",justifyContent:"center",alignItems:"center",width:80}}>
        <Text style={{color:"white",fontSize:9,opacity:0.5}}>Your location</Text>
        <Text style={{color:"white",fontSize:10}}>{room_name}</Text>
          </View>}
        </TouchableOpacity>
        {Roomconnected?<View style={{position:"absolute",bottom:20,width,alignItems:"center"}}>
        <Animatable.View 
        animation="slideInUp"
        duration={1000}
        easing="ease-in-out-back"
        useNativeDriver
       style={{padding:15,marginTop:5,width:width-80,justifyContent:"center",alignItems:"center",marginBottom:(height/7)}}>
         <BtnG 
         textColor="black"
        onPress={()=>JoinROOM({name:nickname,room:room_name})}
        text={`Join ${street} Room`}
         />
       </Animatable.View>
       </View>:null}
        </View>
        </View>
)
}
const mapDispatchToProps = (state)=>{
  return state;
}
export default connect(mapDispatchToProps)(Home);
